import React,{useEffect,useState} from 'react';
import {Button,Link,Menu,Select,MenuItem,InputLabel,FormControl,TextField,Fade} from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import './style.scss';
import { useNavigate, useLocation } from 'react-router-dom';
function Header() {
  const [menuToggled, setMenuToggled] = useState(false);
  const navigate = useNavigate ();
  const [anchorEl, setAnchorEl] = React.useState(null);
  const open = Boolean(anchorEl);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleClose = () => {
    setAnchorEl(null);
  };
  const handlePartTimer = () =>{
    const token = localStorage.getItem('token');
    const loginType = JSON.parse(localStorage.getItem('currentUser'));

    if(token){
      loginType.types[0] === 2 ?  navigate('/explorejobs?roles=employee') : alert("Access Denied") 
    }else{
      navigate('/login?roles=employee')
    }
  }
  const handleEmployer = () =>{
    const token = localStorage.getItem('token');
    const loginType = JSON.parse(localStorage.getItem('currentUser'));
    if(token){
      loginType?.types[0] === 1 ?  navigate('/dashboard') : alert("Access Denied")

    }else{
      navigate('login?roles=employer')
    }
  }
  const handleredirect = () =>{

      navigate('/explore-certifications')

  }
  useEffect(() => {
    if (menuToggled) {
      document.body.classList.add('menuOpen');
    } else {
      document.body.classList.remove('menuOpen');
    }
  }, [menuToggled]);

  const menuToggle = () => {
    setMenuToggled(!menuToggled);
  };
    return (
      <>
      {/* Home Header Start */}
      <div className="HomeHeaderContainer">
        <div className="HomeHeaderLeft">
        <Button className="mobileMenuBtn" display={{ xs: "block", md: "none" }} onClick={menuToggle}>
            <img src={require("../../assets/images/menu.png")} className="mobileMenuImg"/>
          </Button>
          <Link href="javascript:;">
            <img src={require("../../assets/images/Logo White TM.png")} className="logo"/>
          </Link>
          <div className="MenuListContainer">
          <Link href="javascript:;" display={{ xs: "block", md: "none" }}>
              <img src={require("../../assets/images/Logo White TM.png")} className="logo"/>
            </Link>
            {/* <Link href="/login?roles=employer">Employers</Link>  */}
            {/* <Link href="/login?roles=employee">Part Timer</Link> */}
            <Link onClick={handleredirect} className='pointierCursor' >Certification Cources</Link>
            <Link onClick={handleEmployer} className='pointierCursor' >Employers</Link>
            <Link onClick={handlePartTimer} className='pointierCursor' >Part Timer</Link>

            {/* <Link href="javascript:;">Subscription</Link> */}
          </div>
          <div className="menuOverlay" display={{ xs: "block", lg: "none" }} onClick={menuToggle} />
        </div>
        <div className="HomeHeaderRight">
            <Button  onClick={()=> navigate("/login?roles=employee")}  className="getStartBtn">Get Started</Button>
        </div>
      </div>
      {/* Home Header End */}
      {/* Employeer Before Login Header Start */}
      <div className="EmployeerHeaderContainer" style={{display: 'none'}}>
        <Link href="javascript:;">
          <img src={require("../../assets/images/Logo Blue TM.png")} className="logo"/>
        </Link>
        <div className="EmployeerHeaderMenu">
        <div className="menuDropdown">
          <Button
            id="fade-button"
            aria-controls={open ? 'fade-menu' : undefined}
            aria-haspopup="true"
            aria-expanded={open ? 'true' : undefined}
            onClick={handleClick}
          >
            <span>Job seekers</span>
            <img src={require("../../assets/images/menu-down.png")} className="downArrow"/>
          </Button>
          <Menu
            id="fade-menu"
            MenuListProps={{
              'aria-labelledby': 'fade-button',
            }}
            anchorEl={anchorEl}
            open={open}
            onClose={handleClose}
            TransitionComponent={Fade}
          >
            <MenuItem onClick={handleClose}>Profile</MenuItem>
            <MenuItem onClick={handleClose}>My account</MenuItem>
            <MenuItem onClick={handleClose}>Logout</MenuItem>
          </Menu>
        </div>
        <div className="menuDropdown">
          <Button
            id="fade-button"
            aria-controls={open ? 'fade-menu' : undefined}
            aria-haspopup="true"
            aria-expanded={open ? 'true' : undefined}
            onClick={handleClick}
          >
            <span>Employer</span>
            <img src={require("../../assets/images/menu-down.png")} className="downArrow"/>
          </Button>
          <Menu
            id="fade-menu"
            MenuListProps={{
              'aria-labelledby': 'fade-button',
            }}
            anchorEl={anchorEl}
            open={open}
            onClose={handleClose}
            TransitionComponent={Fade}
          >
            <MenuItem onClick={handleClose}>Profile</MenuItem>
            <MenuItem onClick={handleClose}>My account</MenuItem>
            <MenuItem onClick={handleClose}>Logout</MenuItem>
          </Menu>
        </div>

            {/* <form>
              <div className="headerSearchBar">
              <FormControl fullWidth>
                    <InputLabel id="demo-simple-select-label">Categories</InputLabel>
                    <Select
                      labelId="demo-simple-select-label"
                      id="demo-simple-select"
                      className="form-control form-control-select"
                      label="Categories"
                    >
                      <MenuItem value={10}>Category 1</MenuItem>
                      <MenuItem value={20}>Category 2</MenuItem>
                      <MenuItem value={30}>Category 3</MenuItem>
                    </Select>
                  </FormControl>
                  <TextField
                        id="last_name"
                        label="Job title, Skills or Company"
                        className="form-control"
                        InputProps={{
                            type: 'text',
                          }}
                    />
                    <Button>
                          <SearchIcon/>
                    </Button>
              </div>
            </form> */}

        <div className="menuDropdown">
          <Button
            id="fade-button"
            aria-controls={open ? 'fade-menu' : undefined}
            aria-haspopup="true"
            aria-expanded={open ? 'true' : undefined}
            onClick={handleClick}
          >
            <img src={require("../../assets/images/menu-user.png")} className="menuUser"/>
            <span>Welcome</span>
            <img src={require("../../assets/images/menu-down.png")} className="downArrow"/>
          </Button>
          <Menu
            id="fade-menu"
            MenuListProps={{
              'aria-labelledby': 'fade-button',
            }}
            anchorEl={anchorEl}
            open={open}
            onClose={handleClose}
            TransitionComponent={Fade}
          >
            <MenuItem onClick={handleClose}>Profile</MenuItem>
            <MenuItem onClick={handleClose}>My account</MenuItem>
            <MenuItem onClick={handleClose}>Logout</MenuItem>
          </Menu>
        </div>
        </div>
      </div>
      {/* Employeer Before Login Header End */}
      </>
    );
  }

  export default Header;
